


import Content from "./Content"
const pic = [
    {
        id: 0
        , src: "data:image/jpeg;base64,"
    },
    {
        id: 1
        , src: "data:image/jpeg;base64,"
    },
    {
        id: 2
        , src: "data:image/jpeg;base64,"
    },
    {
        id: 3
        , src: "data:image/jpeg;base64,"
    },
    {
        id: 4
        , src: "data:image/jpeg;base64,"
    },
]

const arr = [];
const map = new Set();
let i = 0
while (i >= 0) {
    if (map.has(0) && map.has(1) && map.has(2) && map.has(3) && map.has(4)) {
        break;
    } else {
        let index = parseInt(Math.random() * 10)
        if (index < 5 && !map.has(index)) {
            map.add(index);
            arr.push(index);
        } else {
            continue;
        }
    }
}
console.log(map);
let identical = null
while (i <= 0) {
    let num = parseInt(Math.random() * 10)
    if (num < 5) {
        identical = num;
        break;
    } else {
        continue;
    }
}


export default function MainPage() {
    return <div>
        <Content arr={arr} identical={identical} pic={pic} />
    </div>
}